import React from "react";
import "../css/pages.css"; // Import the CSS file

const Pages = () => {
  return (
    <div id="page" className="home-container">
      <div className="image-container">
        <img
          src="/img/building.jpg"
          alt="First Image"
          className="collage-image first-image"
        />
        <img
          src="sofa.jpg"
          alt="Second Image"
          className="collage-image second-image"
        />
        <img
          src="path_to_third_image.jpg"
          alt="bsofa.jpg"
          className="collage-image third-image"
        />
      </div>
    </div>
  );
};

export default Pages;
